const test = <b> aaa </b>;
const test2 = '<b> aa </b>';

const [test3, settest3] = useState('');
const [test4, settest4] = useState('');

settest3(<b> eee </b>);
settest4('<b> eee </b>');
// const numbers = ['<b> aaa </b>', test, 3, 4, <b> test </b>];

class Example extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      username: test,
      password: test2,
    };
  }
  
    render() {
      return (
        <div>
          <p> test {this.state.username} razy {this.state.password}</p>
          </div>
      );
    }
  }
  export default Example
